import tarot from '../images/tarot.png'

const data = [
    {
        id: 1,
        image: {tarot},
        title: 'test 1',
        category: ['javascript', 'html']
    },
    {
        id: 2,
        image: {tarot},
        title: 'test 2',
        category: ['javascript', 'html']
    },
]

export default data
